import React from 'react'
import { Card, CardContent, CardActions, Typography, FormControl, InputLabel, OutlinedInput, makeStyles } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    form: { padding: "2rem 1rem" }
}))

const CommonCard = () => {
    const classes = useStyles();
    return (
        <>
            <Card>
                <CardContent>
                    <Typography align="center" variant="h4" gutterBottom>Google</Typography>
                    <Typography align="center" variant="h5" gutterBottom>Sign in</Typography>
                    <Typography align="center" variant="subtitle1">to continue to Gmail</Typography>
                </CardContent>
                <CardActions>
                    <form className={classes.form}>
                        <FormControl variant="outlined">
                            <InputLabel htmlFor="outlined-adornment-amount">Email or phone</InputLabel>
                            <OutlinedInput
                                id="outlined-adornment-amount"
                                labelWidth={115}
                            />
                        </FormControl>
                    </form>
                </CardActions>
            </Card>
        </>
    )
}

export default CommonCard
